import React, {useState} from "react"

function ProfileScreenDemo() {
    // setProfile will only change the local data NOT globle.
    const [profile, setProfile] = useState({
        firstName: "jin",
        lastName:"John",
        email: "jin@gmail.com",
        phone:"123-123-1234",
        address: "123 main st"
});

    return (
        <div>
            <h1>Profile Screen Demo</h1>

            <label>First Name</label><br/>
            <input 
                value={profile.firstName}
                onChange={ (e) => setProfile({
                    ...profile,
                    firstName: e.target.value,
                })}
                /><br/><br/>

            <label>Last Name</label><br/>
            <input value={profile.lastName} /><br/><br/>

            <label>Email</label><br/>
            <input value={profile.email} /><br/><br/>

            <label>Phone</label><br/>
            <input value={profile.phone} /><br/><br/>

            <label>Address</label><br/>
            <input value={profile.address} /><br/><br/>

        </div>


    )
}

export default ProfileScreenDemo;



